import React, { Component } from 'react';
import Navbar2 from '../components/Navbar2';
import Navbar3 from '../components/Navbar3';

class Download extends Component {
    state = {  }
    render() { 
        return ( 
            <section>
                <Navbar2 />
                <Navbar3 />
                <br></br>
                <br></br>
                <div className='container-fluid'>
                    <div className='row'>
                        <div className='col-7 mx-auto'>
                            <div className='card'>
                                <div style={{color:'white',backgroundColor:'#3D506B',borderRadius:'5px 5px 0 0'}} className='card-header col-12'>
                                    <h3>Unduh</h3>
                                </div>
                                <div className='card-body'>
                                    <select className='form-control mt-3 text-center' style={{color:'white',backgroundColor:'#3D506B',textAlignLast:'center'}}>
                                        <option>JARKOM</option>
                                        <option>APPL</option>
                                        <option>DAP</option>
                                        <option>PBO</option>
                                    </select>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
         );
    }
}

export default Download;
